import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <header>
            <div className="container">
                <ul className="navbarItems">
                    <li></li>
                    <Link to="/">Todo list</Link>
                    <Link to="/">About</Link>
                    <Link to="/">Logout</Link>
                </ul>
            </div>
        </header>
    )
}

export default Navbar
